INSERT INTO `membertbl` (`id`, `membername`, `membernameprofileind`, `screenname`, `gender`, `genderprofileind`, `avatar`, `role`, `email`, `emailprofileind`, `street`, `city`, `state`, `zip`, `addressprofileind`, `phonenumber`, `phonenumberprofileind`, `favoriteteamid`, `noemail`, `biography`, `biographyprofileind`, `passwd`, `status`, `enterdate`, `createdate`) VALUES (80,'Phil Simms',1,'Phil Simms','Male',1,'CBSSportsAnalyst.png','expert','',0,'','',NULL,'',1,'',0,0,1,'Phillip Martin Simms (born November 3, 1955) is a former American football quarterback who spent his entire 14-year professional career playing for the New York Giants of the National Football League (NFL). <br><br> He is currently a television sportscaster for the CBS network. Simms was drafted in the first round by the New York Giants of the National Football League (NFL) with the number seven selection overall in the 1979 NFL Draft. Simms was named Most Valuable Player (MVP) of Super Bowl XXI, after he led the Giants to a victory over the Denver Broncos and set the record for highest completion percentage in a Super Bowl, completing 22 of 25 passes (88%). He also was named to the Pro Bowl for his performances in the 1985 and 1993 seasons.\r\n <br><br>\r\nHe is the father of former NFL quarterback, New England Patriots assistant coach, and current Fox Sports college football analyst Chris Simms, as well as Atlanta Falcons quarterback Matt Simms','1','Phil Simms','active','2017-09-24 16:11:56',NULL);
INSERT INTO `membertbl` (`id`, `membername`, `membernameprofileind`, `screenname`, `gender`, `genderprofileind`, `avatar`, `role`, `email`, `emailprofileind`, `street`, `city`, `state`, `zip`, `addressprofileind`, `phonenumber`, `phonenumberprofileind`, `favoriteteamid`, `noemail`, `biography`, `biographyprofileind`, `passwd`, `status`, `enterdate`, `createdate`) VALUES (81,'Kurt Warner',1,'Kurt Warner','Male',1,'NFLNetworkSportsAnalyst.png','expert','',0,'','',NULL,'',1,'',0,0,1,'Kurtis Eugene Warner (born June 22, 1971) is a former American football quarterback, a current part-time TV football analyst, and a philanthropist. He played for three National Football League (NFL) teams: the St. Louis Rams, the New York Giants, and the Arizona Cardinals.  <br><br>Warner went on to be considered the best undrafted NFL player of all time. Warner was inducted into the Pro Football Hall of Fame in 2017, and is the only person inducted into both the Pro Football Hall of Fame and the Arena Football Hall of Fame. <br><br>\r\nWarner first attained stardom while playing for the St. Louis Rams from 1998 to 2003, where he won NFL MVP awards in 1999 and 2001 as well as the Super Bowl MVP award in Super Bowl XXXIV when he and the Rams beat the Tennessee Titans. He led the 2008 Arizona Cardinals to Super Bowl XLIII (the franchise\'s first Super Bowl berth),','1','Kurt Warner','active','2017-09-25 01:48:15',NULL);
INSERT INTO `membertbl` (`id`, `membername`, `membernameprofileind`, `screenname`, `gender`, `genderprofileind`, `avatar`, `role`, `email`, `emailprofileind`, `street`, `city`, `state`, `zip`, `addressprofileind`, `phonenumber`, `phonenumberprofileind`, `favoriteteamid`, `noemail`, `biography`, `biographyprofileind`, `passwd`, `status`, `enterdate`, `createdate`) VALUES (82,'Boomer Esiason',1,'Boomer Esiason','Male',1,'CBSSportsAnalyst.png','expert','',0,'','',NULL,'',1,'',0,0,1,'Norman Julius \'Boomer\' Esiason; born April 17, 1961) is a retired American football quarterback and current network color commentator. <br><br> During a 14-year career in the National Football League (NFL), Esiason played for the Cincinnati Bengals, New York Jets, and Arizona Cardinals.  <br><br>Since retiring, he has worked as a football analyst, first for ABC and HBO, and currently for CBS Sports on The NFL Today, Westwood One for Monday Night Football and the Super Bowl, and Showtime\'s Inside the NFL. Esiason also hosts the morning sports radio program The Morning Show with Boomer on WFAN (AM) in New York.','1','Boomer Esiason','active','2017-09-25 01:15:43',NULL);
INSERT INTO `membertbl` (`id`, `membername`, `membernameprofileind`, `screenname`, `gender`, `genderprofileind`, `avatar`, `role`, `email`, `emailprofileind`, `street`, `city`, `state`, `zip`, `addressprofileind`, `phonenumber`, `phonenumberprofileind`, `favoriteteamid`, `noemail`, `biography`, `biographyprofileind`, `passwd`, `status`, `enterdate`, `createdate`) VALUES (83,'NFL Fan Picks',1,'NFL Fan Picks','Other',1,'NFLNetworkSportsAnalyst.png','expert','',0,'','Cities Across U.S.A',NULL,'',1,'',0,0,1,'These are picks made by NFL fans collected by the NFL website.','1','NFL Fan Picks','active','2017-09-24 16:52:20',NULL);
INSERT INTO `membertbl` (`id`, `membername`, `membernameprofileind`, `screenname`, `gender`, `genderprofileind`, `avatar`, `role`, `email`, `emailprofileind`, `street`, `city`, `state`, `zip`, `addressprofileind`, `phonenumber`, `phonenumberprofileind`, `favoriteteamid`, `noemail`, `biography`, `biographyprofileind`, `passwd`, `status`, `enterdate`, `createdate`) VALUES (84,'Bill Cowher',1,'Bill Cowher','Male',1,'CBSSportsAnalyst.png','expert','',0,'','',NULL,'',1,'',0,0,1,'William Laird Cowher (born May 8, 1957) is a former professional American football coach and player in the National Football League (NFL). In Cowher\'s 15 seasons as head coach of the Pittsburgh Steelers, the team won eight division titles and made 10 playoff appearances. <br><br>Cowher led the Steelers to the Super Bowl twice, winning one. He is the second coach in NFL history to reach the playoffs in each of his first six seasons as head coach, a feat previously accomplished by Paul Brown.  <br><br> He is currently a studio analyst for The NFL Today.','1','Bill Cowher','active','2017-09-25 02:06:13',NULL);
INSERT INTO `membertbl` (`id`, `membername`, `membernameprofileind`, `screenname`, `gender`, `genderprofileind`, `avatar`, `role`, `email`, `emailprofileind`, `street`, `city`, `state`, `zip`, `addressprofileind`, `phonenumber`, `phonenumberprofileind`, `favoriteteamid`, `noemail`, `biography`, `biographyprofileind`, `passwd`, `status`, `enterdate`, `createdate`) VALUES (85,'Steve Mariucci',1,'Steve Mariucci','Male',1,'NFLNetworkSportsAnalyst.png','expert','',0,'','',NULL,'',1,'',0,0,1,'Stephen Ray Mariucci (born November 4, 1955), nicknamed \'Mooch\', is an American sportscaster and former football coach who was the head coach of two different National Football League teams, the San Francisco 49ers and the Detroit Lions, as well as the California Golden Bears football team of the University of California.','1','Steve Mariucci','active','2017-09-24 16:07:55',NULL);
INSERT INTO `membertbl` (`id`, `membername`, `membernameprofileind`, `screenname`, `gender`, `genderprofileind`, `avatar`, `role`, `email`, `emailprofileind`, `street`, `city`, `state`, `zip`, `addressprofileind`, `phonenumber`, `phonenumberprofileind`, `favoriteteamid`, `noemail`, `biography`, `biographyprofileind`, `passwd`, `status`, `enterdate`, `createdate`) VALUES (86,'Michael Irvin',1,'Michael Irvin','Male',1,'NFLNetworkSportsAnalyst.png','expert','',0,'','',NULL,'',1,'',0,0,1,'Michael Jerome Irvin (born March 5, 1966) is a retired American football player, actor, and sports commentator. Irvin played college football at the University of Miami, then for the Dallas Cowboys of the National Football League (NFL) for his entire pro athletic career (1988-1999), which ended due to a spinal cord injury. <br><br> Irvin was nicknamed \'The Playmaker\' due to his penchant for making big plays in big games during his college and pro careers. He is one of three key Cowboys offensive players who helped the team attain three Super Bowl wins: he is known as one of \'The Triplets\' along with Troy Aikman and Emmitt Smith.<br><br> He is also a former broadcaster for ESPN\'s Sunday NFL Countdown and currently an analyst for NFL Network. In 2007, he was selected to the Pro Football Hall of Fame.','1','Michael Irvin','active','2017-09-25 01:54:05',NULL);
INSERT INTO `membertbl` (`id`, `membername`, `membernameprofileind`, `screenname`, `gender`, `genderprofileind`, `avatar`, `role`, `email`, `emailprofileind`, `street`, `city`, `state`, `zip`, `addressprofileind`, `phonenumber`, `phonenumberprofileind`, `favoriteteamid`, `noemail`, `biography`, `biographyprofileind`, `passwd`, `status`, `enterdate`, `createdate`) VALUES (87,'Marshall Faulk',1,'Marshall Faulk','Male',1,'NFLNetworkSportsAnalyst.png','expert','',0,'','',NULL,'',1,'',0,0,1,'Marshall William Faulk (born February 26, 1973) is a former American football player who was a running back in the National Football League (NFL) for twelve seasons. He played college football for San Diego State University. He was selected by the Indianapolis Colts as the second overall pick in the 1994 NFL Draft, and he also played professionally for the NFL\'s St. Louis Rams.  Faulk is one of only three NFL players (Marcus Allen and Tiki Barber being the others) to reach at least 10,000 rushing yards and 5,000 receiving yards; he is the only one to amass 12,000 yards rushing and 6,000 yards receiving. <br><br> Faulk was inducted into the Pro Football Hall of Fame in 2011 and the College Football Hall of Fame in 2017. He is currently a pro football analyst for NFL Total Access, Thursday Night Football, and NFL GameDay Morning on the NFL Network.','1','Marshall Faulk','active','2017-09-25 01:52:46',NULL);
